import React from "react";
import { Editor } from "@tinymce/tinymce-react";

function Tiny() {
  return (
    <Editor
      apiKey="Get your free API key at tiny.cloud and paste it here"
      plugins="wordcount"
    />
  );
}

export default Tiny;
